import Layout from "../layout";

function Register() {
  return (
    <Layout>
      <div className="w-2/4 m-auto py-10">
        <h2 className="font-medium text-2xl text-gray-700 mb-5">
          Enter your email to join or sign in.
        </h2>
      </div>
    </Layout>
  );
}

export default Register;
